// ------------------------------------------------------------------------------------------------------------
// VGDD Automatic Event Handling - Draw Callback routine
// ------------------------------------------------------------------------------------------------------------
// The VGDD_MenuScreens_DrawCallback function will take care of calling the CreateXXX() subroutines in order
// to draw widgets defined in the screen, according to the current screenState variable.
// In order for it to work, you have to insert a call to VGDD_MenuScreens_DrawCallback into your main
// "standard" GOLDrawCallback function (see Microchip's demos) with no parameters:
// return(VGDD_MenuScreens_DrawCallback());
WORD VGDD_MenuScreens_DrawCallback(void) {
    switch (screenState) {
        case CREATE_MAINMENU:
            CreateMainMenu();
            screenState = UPDATE_MAINMENU;
            break;
        case UPDATE_MAINMENU:
            
            screenState = DISPLAY_MAINMENU;
            break;
        case DISPLAY_MAINMENU:
            break;
            
        case CREATE_FOODMENU:
            CreateFoodMenu();
            screenState = UPDATE_FOODMENU;
            break;
        case UPDATE_FOODMENU:
            
            screenState = DISPLAY_FOODMENU;
            break;
        case DISPLAY_FOODMENU:
            break;
            
        case CREATE_APPETIZERLIST:
            CreateAppetizerList();
            screenState = UPDATE_APPETIZERLIST;
            break;
        case UPDATE_APPETIZERLIST:
            
            screenState = DISPLAY_APPETIZERLIST;
            break;
        case DISPLAY_APPETIZERLIST:
            break;
            
        case CREATE_SANDWICHESLIST:
            CreateSandwichesList();
            screenState = UPDATE_SANDWICHESLIST;
            break;
        case UPDATE_SANDWICHESLIST:
            
            screenState = DISPLAY_SANDWICHESLIST;
            break;
        case DISPLAY_SANDWICHESLIST:
            break;
            
        case CREATE_SANDWICHESLIST2:
            CreateSandwichesList2();
            screenState = UPDATE_SANDWICHESLIST2;
            break;
        case UPDATE_SANDWICHESLIST2:
            
            screenState = DISPLAY_SANDWICHESLIST2;
            break;
        case DISPLAY_SANDWICHESLIST2:
            break;
            
        case CREATE_SALADSLIST1:
            CreateSaladsList1();
            screenState = UPDATE_SALADSLIST1;
            break;
        case UPDATE_SALADSLIST1:
            
            screenState = DISPLAY_SALADSLIST1;
            break;
        case DISPLAY_SALADSLIST1:
            break;
            
        case CREATE_SALADLIST2:
            CreateSaladList2();
            screenState = UPDATE_SALADLIST2;
            break;
        case UPDATE_SALADLIST2:
            
            screenState = DISPLAY_SALADLIST2;
            break;
        case DISPLAY_SALADLIST2:
            break;
            
            
        default:
            break;
    } // End switch (screenState)
    return (1);
} // End VGDD_MenuScreens_DrawCallback

